(501, 2, 4, 'Universitas Jenderal Achmad Yani memperoleh Peringkat \"Kluster Utama\" Tahun 2024', 'universitas-jenderal-achmad-yani-memperoleh-peringkat-kluster-utama-tahun-2024', 'post-images/OETx04GunstpbfAxn4y6vs1JpjfmoLBrrO9lmfoQ.jpg', '(Humas Unjani) - Klasterisasi perguruan tinggi tahun 2024 didasarkan pada hasil olahan data kinerja perguruan tinggi berbasis SINTA dalam periode tahun 2020 hingga 2022. Data kinerja yang diperhitungk...', '<div>(Humas Unjani) - Klasterisasi perguruan tinggi tahun 2024 didasarkan pada hasil olahan data kinerja perguruan tinggi berbasis SINTA dalam periode tahun 2020 hingga 2022. Data kinerja yang diperhitungkan merupakan data yang telah diverifikasi dan divalidasi oleh verifikator Lembaga Penelitian dan Pengabdian kepada Masyarakat (LPPM) Perguruan Tinggi.<br><br>Universitas Jenderal Achmad Yani berada di \"Kluster Utama\" bersama 194 PT lainnya dari total 943 Perguruan Tinggi se-Indonesia.<br><br></div><div>Unjani terus berkomitmen untuk terus melakukan peningkatan dengan akselerasi kinerja PT dengan skema kolaborasi Penta Helix dengan pihak lainnya yang ditunjukkan dengan berbagai kerjasama baik dengan perguruan tinggi di dalam dan luar negeri, industri dan kelompok masyarakat.<br><br></div><div>Sumber: https://bima.kemdikbud.go.id/</div>', '2024-03-01 13:07:37', '2024-02-29 09:32:31', '2024-03-01 06:07:37'),
(502, 1, 4, 'Universitas Jenderal Achmad Yani Tandatangani Nota Kesepahaman dengan TNI', 'universitas-jenderal-achmad-yani-tandatangani-nota-kesepahaman-dengan-tni', 'post-images/fqqnclunpcYzdLCryVk4Ex6ve0pswBYNKm9sexcw.jpg', 'Humas – Universitas Jenderal Achmad Yani kembali melakukan kerjasama di bidang Tri Dharma Perguruan Tinggi, dan kali ini menandatangani Nota Kesepahaman dengan Tentara Nasional Indonesia (TNI). Kegiat...', '<div><strong>Humas </strong>– Universitas Jenderal Achmad Yani kembali melakukan kerjasama di bidang Tri Dharma Perguruan Tinggi, dan kali ini menandatangani Nota Kesepahaman dengan Tentara Nasional Indonesia (TNI). Kegiatan ini telah dilaksanakan pada hari Kamis (28/12) dan bertempat di Ruang Serbaguna Aspers TNI, Gedung Urip Soemoharjo Mabes TNI, Cilangkap, Jakarta Timur.<br><br>Kegiatan dimulai dengan sambutan yang disampaikan oleh Rektor Unhan RI yang diwakilkan oleh Wakil Rektor IV Unhan RI, Mayjen TNI Dr. Ir. Susilo Adi Purwantoro, S.E., M.Eng.,Sc., CIQnR., CIQaR., IPU., CIPA., ASEAN Eng. Dilanjutkan dengan sambutan dari Aspers TNI, Marsda TNI Arif Widianto, S.A.B., M.Tr.(Han).<br><br></div><div>Dalam sambutannya, Aspers TNI menyampaikan bahwa penandatanganan Nota Kesepahaman antara TNI dengan Perguruan Tinggi menandakan kolaborasi sebagai bagian dari Pentahelix yang sedang dibangun dalam mewujudkan SDM Unggul menuju Indonesia Emas 2045. Hal ini juga tentunya berkaitan dengan Pokok Kebijakan Panglima TNI dalam prioritas menuju TNI yang PRIMA (Profesional, Responsif, Integratif, Modern, dan Adaptif), khusus dalam bidang personel mewujudkan SDM Unggul, Profesional, dan Tangguh. Salah satunya dengan melakukan inovasi-inovasi dalam pengembangan ilmu pengetahuan dan teknologi.<br><br>Setelah sambutan, kegiatan masuk kepada acara inti yaitu penandatanganan Nota Kesepahaman. Dalam kesempatan ini, Rektor Universitas Jenderal Achmad Yani, Prof. Hikmahanto Juwana, S.H., LL.M., Ph.D menandatangani langsung Nota Kesepahaman tersebut bersama dengan Aspers TNI. Pada kesempatan ini juga, TNI tidak hanya bekerjasama dengan Universitas Jenderal Achmad Yani melainkan juga ada beberapa Perguruan Tinggi lainnya seperti Universitas Jenderal Achmad Yani Yogyakarta (Unjaya), Universitas Pertahanan RI (Unhan RI), Universitas Dirgantara Marsekal Suryadarma (Unsurya), Universitas Krisnadwipayana (Unkris), dan Universitas Terbuka (UT). <strong>(ISM)</strong></div>', '2024-02-29 16:34:37', '2024-02-29 09:34:37', '2024-02-29 09:34:37'),
(503, 1, 4, 'LDKK Mahasiswa Baru Universitas Jenderal Achmad Yani T.A. 2023/2024 Resmi Selesai', 'ldkk-mahasiswa-baru-universitas-jenderal-achmad-yani-t-a-2023-2024-resmi-selesai', 'post-images/MtHjOgR04SjbtiQznPsaxGoovJ0Kyg3dbUnHW2UV.jpg', 'Humas – Tepat Pada hari Sabtu (23/12) dan bertempat di Lapangan Djarot Soepadmo, Pusdik Armed pukul 08.34 WIB, kegiatan Latihan Dasar Kedisiplinan dan Kepemimpinan (LDKK) Universitas Jenderal Achmad Y...', '<div><strong>Humas </strong>– Tepat Pada hari Sabtu (23/12) dan bertempat di Lapangan Djarot Soepadmo, Pusdik Armed pukul 08.34 WIB, kegiatan Latihan Dasar Kedisiplinan dan Kepemimpinan (LDKK) Universitas Jenderal Achmad Yani Tahun 2023 resmi di tutup oleh Rektor Universitas Jenderal Achmad Yani Prof. Hikmahanto Juwana, S.H., LL.M., Ph.D. Kegiatan penutupan ini diikuti oleh seluruh peserta LDKK mulai dari Gelombang 1 hingga Gelombang 3.<br><br>Rektor berharap mahasiswa dapat menunjukkan rasa bangga mereka terhadap almamater dengan mencapai prestasi dalam kegiatan universitas dan di tingkat nasional atau pun internasional. Beliau juga berharap mahasiswa akan merasakan perubahan setelah LDKK selesai. Selain itu, Rektor juga menyampaikan bahwa tujuan dari LDKK pertama, untuk memberikan pemahaman kepada generasi muda mengenai nilai-nilai disiplin, loyalitas, dan sikap santun. Kedua, kegiatan LDKK dilakukan karena Universitas Jenderal Achmad Yani milik dari TNI AD dan harus punya pembeda dengan universitas lain di Indonesia. Ketiga, LDKK merupakan modal bagi para mahasiswa untuk lebih giat belajar, dan harapannya, mahasiswa Universitas Jenderal Achmad Yani memiliki karakteristik dengan memiliki disiplin tinggi, loyalitas, dan santun. Sehingga, hal ini menjadi modal untuk memudahkan dalam mencari pekerjaan nantinya.<br><br>Para mahasiswa Gelombang 3 yang terdiri dari 1.136 peserta telah mengikuti LDKK dari hari Rabu (20/12) hingga hari Sabtu. Pada gelombang ke-3 ini sedikit berbeda karena terdapat 10 mahasiswa yang berasal dari Universitas Respati Indonesia (URINDO). Total keseluruhan mencapai 3.500 mahasiswa Universitas Jenderal Achmad Yani dari Gelombang 1 sampai dengan Gelombang 3 yang telah mengikuti LDKK.<br><br></div><div>Setelah upacara penutupan selesai, kegiatan dilanjutkan dengan demonstrasi dari para mantan siswa LDKK yang meliputi Senam Kombat dan yel-yel, selain itu dilakukan juga pemberian penghargaan kepada 12 peserta LDKK terbaik. Ke-12 peserta tersebut dari Fakultas Teknik (Yasmin N dan Abdurrahman F), Fakultas Kedokteran (Fallerine), Fakultas Ilmu dan Teknologi Kesehatan (Azma F, Erlinda V, dan Nur Amalia) Fakultas Kedokteran Gigi (Ivanka A dan Ni Putuh), Fakultas Ilmu Sosial dan Ilmu Politik (Asep Y dan Putri W), Fakultas Psikologi (Ridwan P), dan Fakultas Ekonomi dan Bisnis (Helda A).<br><br>Sebagai penutup di penghujung acara, para siswa LDKK yang tergabung dari semua gelombang, membentuk barisan jajar kehormatan. Hal ini dikhususkan untuk mengantar Rektor Universitas Jenderal Achmad Yani dari Mako Pusdik Armed hingga ke gerbang keluar dan menaikki kendaraan dinasnya. <strong>(SALMA/ISM)</strong></div>', '2024-02-29 16:37:00', '2024-02-29 09:37:00', '2024-02-29 09:37:00');
INSERT INTO `posts` (`id`, `category_id`, `user_id`, `title`, `slug`, `image`, `excerpt`, `body`, `published_at`, `created_at`, `updated_at`) VALUES
(504, 3, 4, 'LPPM Universitas Jenderal Achmad Yani Menyelenggarakan Seminar Nasional - Hasil Penelitian dan Pengabdian Masyarakat', 'lppm-universitas-jenderal-achmad-yani-menyelenggarakan-seminar-nasional-hasil-penelitian-dan-pengabdian-masyarakat', 'post-images/3Y4xbkkJkqq7ZMI4RUpGEymU2RWipIvWAc0cKBzZ.jpg', 'Humas - Pada hari Kamis (21/12) dan bertempat di aula Gedung TNI Mulyono FISIP, LPPM Universitas Jenderal Achmad Yani menyelenggarakan acara Seminar Nasional Hasil Penelitian dan Pengabdian Masyarakat...', '<div><strong>Humas</strong> - Pada hari Kamis (21/12) dan bertempat di aula Gedung TNI Mulyono FISIP, LPPM Universitas Jenderal Achmad Yani menyelenggarakan acara Seminar Nasional Hasil Penelitian dan Pengabdian Masyarakat dengan tema, Strategi Pengadopsian Inovasi Hasil Riset Yang Berdampak Pada Dunia Industri.<br><br>Ketua Pusat LPPM Universitas Jenderal Achmad Yani, Dr. Dadan Kurnia, S.IP., M.Si.,&nbsp; dalam laporannya bahwa kegiatan ini merupakan wujud dari akuntabilitas sebagai Lembaga yang bertugas untuk merencanakan, melaksanakan, mengawasi, dan mengevaluasi berbagai kegiatan penelitian dan pengabdian masyarakat yang dilakukan oleh para dosen.<br><br></div><div>Rektor Universitas Jenderal Achmad Yani, Prof. Hikmahanto Juwana, S.H., LL.M., Ph.D, dalam sambutannya berharap jika seluruh civitas akademik yang melakukan penelitian dan pengabdian masyarakat dapat melakukan berbagai inovasi yang nanti inovasi tersebut dapat dimanfaatkan oleh TNI AD serta masyarakat umum.<br><br>Dalam kesempatan ini terdapat beberapa dosen yang meraih penganugerahan prestasi, diantaranya yaitu Dr. Anceu Murniati, S.Si., M.Si (Peraih Penelitian Drtpm Dengan Kategori Peraih Dana Drtpm - Penelitian Dana Terbesar dan Peraih Science And Technology Index (Sinta) Dengan Kategori Peraih Score Sinta Tertinggi Di Universitas Jenderal Achmad Yani), Gunawan Abdillah, S.Si., M.Cs (Penelitian Dosen Pemula (Pdp) Drtpm Dengan Kategori Peraih Dana Drtpm - Penelitian Dosen Pemula (Pdp) Dana Terbesar), Dr. Putu Teta Prihartini Aryanti, S.T, M.T (Peraih Matching Fund Kedai Reka Dengan Kategori Peraih Dana Matching Fund Terbesar dan Peraih Dana Riset Dan Inovasi Untuk Indonesia Maju (Riim) - Lpdp Dengan Kategori Peraih Dana Riset Dan Inovasi Untuk Indonesia Maju (Riim) Terbesar), dan Dr. Apt. Fahrauk Faramayuda, M.Sc (Peraih Pengabdian Kepada Masyarakat Drtpm Dengan Kategori Peraih Dana Hibah Eksternal Pengmas Terbesar Drtpm).<br><br>Pada kegiatan seminar nasional ini, menghadirkan 3 narasumber, diantaranya Prof. Dr. Yadi Ruyadi, M.Si. dengan tema “Best Practices: Manajemen Inovasi Dan Hilirisasi Hasil Riset Di Universitas Pendidikan Indonesia”, Dr. Apt. Neni Nurainy dengan tema “Best Practices: Kolaborasi Peneliti Biofarma Dengan Perguruan Tinggi Dalam Pengembangan Produk Dan Optimalisasi Proses Industri”, dan Prof. Dr. Agus Subagyo, S.IP., M.Si. dengan tema “Pemanfaatan Hasil Riset Perguruan Tinggi Untuk Industri Pertahanan”<br><br></div><div>Setelah pemaparan dari para narasumber kegiatan dilanjutkan dengan Isoma dan diakhiri dengan paparan hasil seminar yang akan dibagi menjadi tiga rumpun keilmuan. <strong>(SALMA/ISMAIL)</strong></div>', '2024-02-29 17:50:34', '2024-02-29 09:38:35', '2024-02-29 10:50:34'),
(515, 1, 4, 'Univesitas Jenderal Achmad Yani Adakan Kuliah Umum Bersama Universitas Pertahanan Nasional Malaysia', 'univesitas-jenderal-achmad-yani-adakan-kuliah-umum-bersama-universitas-pertahanan-nasional-malaysia', 'post-images/O6Ui5OwFKpSvOZL7PwkbCSwraZYpYUIdvOyi3wGa.jpg', 'Humas – Setelah melaksanakan MoU dengan Universitas Pertahanan Nasional Malaysia, terdapat kegiatan kuliah umum bagi mahasiswa Universitas Jenderal Achmad Yani yang bertema,“Challenges of Nationalism...', '<div><strong>Humas – </strong>Setelah melaksanakan MoU dengan Universitas Pertahanan Nasional Malaysia, terdapat kegiatan kuliah umum bagi mahasiswa Universitas Jenderal Achmad Yani yang bertema,<em>“Challenges of Nationalism in the Modern Era According to the UNPM Perspective”</em> dan masih dilaksanakan di Aula Gedung FISIP Jenderal TNI Mulyono pada hari Senin (26/2).<br><br>Pada kesempatan kali ini Brigjen Dr. Mohd Arshil Bin Moideen yang merupakan <em>Dean Of Fakultas Perubatan dan Kesihatan Pertahanan</em> menjadi pembicara pada kuliah umum. Beliau membahas mengenai hal-hal yang berkaitan dengan angkatan bersenjata kemampuan militer Malaysia dalam segi pasukan kesehatan, antara lain MAFHS bertanggung jawab secara strategis untuk menjaga kesehatan dan kesejahteraan anggota militer dan mendukung keberlanjutan militer.<br><br></div><div>Selain itu, juga proyeksi tujuan strategis MAF dan Negara melibatkan analisis dan perencanaan strategis untuk memastikan ketersediaan sumber daya kesehatan yang memadai bagi masyarakat dan anggota militer, serta layanan bantuan kesehatan dalam operasi (HSS) di OPS yang mengawasi layanan kesehatan selama berbagai operasi militer, seperti Medevac udara dan pengendalian wabah di zona konflik.<br><br><br>Dilanjutkan dengan menggambarkan infrastruktur kesehatan, pelatihan personel, dan kemampuan medis MAFHS, menjelaskan struktur organisasi IAM <em>(Integrated Armed Forces Malaysia)</em> dan peran MAFHS di dalamnya. Peran dalam kesehatan awak Pesawat melibatkan lisensi awak pesawat, pelatihan aerofisiologi, dan penanganan aspek kesehatan personel RMAF. Pembahasan diakhiri dengan membahas pengalaman MAFHS dalam medevac udara di berbagai misi kemanusiaan dan konflik internasional serta pencapaian dan keterlibatan MAFHS dalam misi di Bamyan, Afghanistan, termasuk penanganan wabah Brucellosis. <strong>(SALMA/ISM)</strong></div>', '2024-03-01 18:38:56', '2024-03-01 11:38:56', '2024-03-01 11:38:56'),
(517, 3, 4, 'LPPM Universitas Jenderal Achmad Yani Selenggarakan Apel Delegasi Mahasiswa KKN Tematik LLDIKTI IV', 'lppm-universitas-jenderal-achmad-yani-selenggarakan-apel-delegasi-mahasiswa-kkn-tematik-lldikti-iv', 'post-images/bqgUY21vSKrkYlbRr2KYBdBLdp7gIorCQUYn9Rcj.jpg', 'Humas – Pada hari Selasa (20/2) dan bertempat di Lapangan Apel Gedung Rektorat, LPPM Universitas Jenderal Achmad Yani menyelenggarakan Apel Delegasi Mahasiswa KKN Tematik LLDIKTI IV. Dalam kegiatan ap...', '<div><strong>Humas </strong>– Pada hari Selasa (20/2) dan bertempat di Lapangan Apel Gedung Rektorat, LPPM Universitas Jenderal Achmad Yani menyelenggarakan Apel Delegasi Mahasiswa KKN Tematik LLDIKTI IV. Dalam kegiatan apel ini, Kepala Pusat LPPM Universitas Jenderal Achmad Yani, Dr. Dadan Kurnia, S.IP., M.Si. bertindak sebagai pembina apel.<br><br>Kegiatan ini dalam rangka memberangkat mahasiswa Universitas Jenderal Achmad Yani untuk membangun desa yang diusung melalui tema Perguruan Tinggi Mandiri Gotong Royong Membangun Desa Pemerintah Kabupaten Sumedang. Setelah apel delegasi, para mahasiswa yang terpilih diberangkatkan ke Kabupaten Sumedang, dan diterima di Kantor Camat Cisarua, Kantor Desa Bantarmara, dan Kantor Desa Cisalak di hari yang sama.<br><br></div><div>Selamat melaksanakan KKN Tematik, dan harumkan nama Universitas Jenderal Achmad Yani!</div>', '2024-03-01 18:41:12', '2024-03-01 11:41:12', '2024-03-01 11:41:12'),
(518, 1, 4, 'Universitas Jenderal Achmad Yani Laksanakan Upacara Bendera Triwulan 1 Tahun 2024', 'universitas-jenderal-achmad-yani-laksanakan-upacara-bendera-triwulan-1-tahun-2024', 'post-images/PkeW41z5E6ZC382EfAQA7TuUOPiIdD2JZ0KtKs4c.jpg', '<p><strong>Humas </strong>&ndash; Bertempat di Area Parkir Gedung Rektorat, civitas academica Universitas Jenderal Achmad Yani melaksanakan Upacara Bendera Triwulan 1 Tahun 2024 pada hari Senin (19/02). Pelaksanaan upacara bendera ini berdasarkan Surat Edaran Nomor : SE/12/UNJANI/II/2024 dan Fakultas Teknik menjadi panitia penyelenggara kegiatan ini.<br />\r\n<br />\r\nPada upacara bendera ini, Rektor Universitas Jenderal Achmad Yani, Prof. Hikmahanto Juwana, S.H., LL.M., Ph.D bertindak selaku Pembina Upacara. Selain itu, bertindak sebagai Komandan Upacara yaitu Ka Prodi Teknik Geomatika, Kolonel Ctp. Purn. Dr. Ir. Sukanto Hadi, MT.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:183px; width:325px\" />&nbsp;<img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:183px; width:325px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:366px; width:650px\" /></p>\r\n\r\n<p>Rangkaian upacara bendera dimulai dengan Pembina Upacara memasuki lapangan upacara, laporan upacara, penghormatan, pengibaran bendera. Setelah itu, juga dilanjutkan dengan pembacaan Pancasila, pembukaan UUD 1945, pembacaan doa, dan ditutup dengan laporan upacara selesai.<br />\r\n<br />\r\nUpacara Triwulan 1 Tahun 2024 diikuti oleh seluruh unit kerja yang berada di lingkungan Universitas Jenderal Achmad Yani, Rektorat, 10 Fakultas, dan Rumah Sakit Gigi dan Mulut, serta diikuti oleh tenaga kependidikan dan dosen. <strong>(ISM)</strong></p>', '<p><strong>Humas </strong>&ndash; Bertempat di Area Parkir Gedung Rektorat, civitas academica Universitas Jenderal Achmad Yani melaksanakan Upacara Bendera Triwulan 1 Tahun 2024 pada hari Senin (19/02). Pelaksanaan upacara bendera ini berdasarkan Surat Edaran Nomor : SE/12/UNJANI/II/2024 dan Fakultas Teknik menjadi panitia penyelenggara kegiatan ini.<br />\r\n<br />\r\nPada upacara bendera ini, Rektor Universitas Jenderal Achmad Yani, Prof. Hikmahanto Juwana, S.H., LL.M., Ph.D bertindak selaku Pembina Upacara. Selain itu, bertindak sebagai Komandan Upacara yaitu Ka Prodi Teknik Geomatika, Kolonel Ctp. Purn. Dr. Ir. Sukanto Hadi, MT.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:183px; width:325px\" />&nbsp;<img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:183px; width:325px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/SZM08530-1536x864.jpg\" style=\"height:366px; width:650px\" /></p>\r\n\r\n<p>Rangkaian upacara bendera dimulai dengan Pembina Upacara memasuki lapangan upacara, laporan upacara, penghormatan, pengibaran bendera. Setelah itu, juga dilanjutkan dengan pembacaan Pancasila, pembukaan UUD 1945, pembacaan doa, dan ditutup dengan laporan upacara selesai.<br />\r\n<br />\r\nUpacara Triwulan 1 Tahun 2024 diikuti oleh seluruh unit kerja yang berada di lingkungan Universitas Jenderal Achmad Yani, Rektorat, 10 Fakultas, dan Rumah Sakit Gigi dan Mulut, serta diikuti oleh tenaga kependidikan dan dosen. <strong>(ISM)</strong></p>', '2024-03-27 06:26:14', '2024-03-01 11:42:02', '2024-03-26 23:26:14'),
(546, 1, 4, 'Angkat Sumpah Profesi Dokter Gigi Gel. 1 Tahun 2023/2024', 'angkat-sumpah-profesi-dokter-gigi-gel-1-tahun-2023-2024', 'post-images/zD7x2vgW8c3DjR9abAoRZzLMYu3xWP3ecsAqGjn8.jpg', '<p><strong>Humas&nbsp;</strong>&ndash; Bertempat di Mercure City Center, Jalan Lengkong Besar No. 08, Bandung, Jawa Barat, telah dilaksanakan Angkat Sumpah Profesi Dokter Gigi dan Penyerahan Ijazah Gelombang I Tahun Akademik 2023-2024 Fakultas Kedokteran Gigi Universitas Jenderal Achmad Yani. Kegiatan ini terlaksana dengan lancar pada hari Rabu (28/2) pukul 07.00 &ndash; 12.00 WIB.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/EJA_2483-1536x1023.jpg\" style=\"height:216px; width:325px\" />&nbsp;<img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/EJA_3169-1536x1023.jpg\" style=\"height:216px; width:325px\" /></p>\r\n\r\n<p>Kegiatan Angkat Sumpah diawali dengan prosesi sidang senat Fakultas Kedokteran Gigi, lalu dilanjutkan dengan upacara Angkat Sumpah. Selanjutnya, setelah upacara Angkat Sumpah, yakni penandatanganan bukti sumpah Dokter Gigi. Masuk ke bagian inti acara yakni Prosesi Wisuda dan Penyerahan Ijazah Profesi Dokter Gigi.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/ICN_2801-1536x1023.jpg\" style=\"height:433px; width:650px\" /></p>\r\n\r\n<p>Kegiatan Angkat Sumpah Profesi Dokter Gigi dan Penyerahan Ijazah Gelombang I Tahun Akademik 2023-2024 Fakultas Kedokteran Gigi Universitas Jenderal Achmad Yani ditutup dengan foto bersama dan ramah Tamah. Lalu, di penghujung acara, terdapat acara yang dilakukan oleh para Dokter Gigi dengan menyanyi sebagai tanda persembahan kepada orangtua.</p>\r\n\r\n<p>Selamat para Dokter Gigi baru, semoga dapat menjadi Dokter Gigi yang bermanfaat bagi masyarakat, nusa, dan bangsa.</p>', '<p><strong>Humas&nbsp;</strong>&ndash; Bertempat di Mercure City Center, Jalan Lengkong Besar No. 08, Bandung, Jawa Barat, telah dilaksanakan Angkat Sumpah Profesi Dokter Gigi dan Penyerahan Ijazah Gelombang I Tahun Akademik 2023-2024 Fakultas Kedokteran Gigi Universitas Jenderal Achmad Yani. Kegiatan ini terlaksana dengan lancar pada hari Rabu (28/2) pukul 07.00 &ndash; 12.00 WIB.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/EJA_2483-1536x1023.jpg\" style=\"height:216px; width:325px\" />&nbsp;<img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/EJA_3169-1536x1023.jpg\" style=\"height:216px; width:325px\" /></p>\r\n\r\n<p>Kegiatan Angkat Sumpah diawali dengan prosesi sidang senat Fakultas Kedokteran Gigi, lalu dilanjutkan dengan upacara Angkat Sumpah. Selanjutnya, setelah upacara Angkat Sumpah, yakni penandatanganan bukti sumpah Dokter Gigi. Masuk ke bagian inti acara yakni Prosesi Wisuda dan Penyerahan Ijazah Profesi Dokter Gigi.</p>\r\n\r\n<p><img alt=\"\" src=\"https://www.unjani.ac.id/wp-content/uploads/2024/03/ICN_2801-1536x1023.jpg\" style=\"height:433px; width:650px\" /></p>\r\n\r\n<p>Kegiatan Angkat Sumpah Profesi Dokter Gigi dan Penyerahan Ijazah Gelombang I Tahun Akademik 2023-2024 Fakultas Kedokteran Gigi Universitas Jenderal Achmad Yani ditutup dengan foto bersama dan ramah Tamah. Lalu, di penghujung acara, terdapat acara yang dilakukan oleh para Dokter Gigi dengan menyanyi sebagai tanda persembahan kepada orangtua.</p>\r\n\r\n<p>Selamat para Dokter Gigi baru, semoga dapat menjadi Dokter Gigi yang bermanfaat bagi masyarakat, nusa, dan bangsa.</p>', '2024-04-08 21:19:11', '2024-04-08 14:19:11', '2024-04-08 14:19:11');
